// ==UserScript==
// @name         trokkador
// @namespace    http://tampermonkey.net/
// @version      0.8
// @description  troca a palavra  por uma imagem do cara 
// @author       tokkime
// @match        *://*/*
// @grant        none
// ==/UserScript==

(function() {
    'use strict';

    const KEYWORDS = ['tranquila', 's', 'tranquilo', 'tranquilas', 'tranquilos'];
    const IMAGE_URL = 'data:image/png;base64,';
    const SUBSTITUTION_MARKER = 'trokkador-substituido';
    const IGNORED_TAGS = ['script', 'style', 'textarea'];
    const IMAGE_VERTICAL_ALIGN = 'middle';
    const IMAGE_DISPLAY = 'inline';
    const IMAGE_RENDERING_PIXELATED = 'pixelated';
    const IMAGE_RENDERING_CRISP_EDGES = 'crisp-edges';
    const SUBSTITUTION_DELAY = 500;
    const FONT_SIZE_MULTIPLIER = 0.4;
    const IMAGE_WIDTH_PADDING = 60;
    const IMAGE_HEIGHT_PADDING = 15;

    function shouldIgnoreNode(node) {
        return (
            node.isSubstitute ||
            !node.parentElement ||
            IGNORED_TAGS.includes(node.parentElement.tagName.toLowerCase()) ||
            node.parentElement.classList.contains(SUBSTITUTION_MARKER)
        );
    }

    function estimateImageWidth(parentElement) {
        const computedStyle = window.getComputedStyle(parentElement);
        const fontSize = parseFloat(computedStyle.fontSize);
        const charCount = KEYWORD.length;
        return charCount * (fontSize * FONT_SIZE_MULTIPLIER) + IMAGE_WIDTH_PADDING;
    }

    function createImageElement(parentElement) {
        const img = document.createElement('img');
        img.src = IMAGE_URL;
        img.classList.add(SUBSTITUTION_MARKER);
        const fontSize = parseFloat(window.getComputedStyle(parentElement).fontSize);
        img.style.height = `${fontSize + IMAGE_HEIGHT_PADDING}px`;
        img.style.width = `${estimateImageWidth(parentElement)}px`;
        img.style.verticalAlign = IMAGE_VERTICAL_ALIGN;
        img.style.display = IMAGE_DISPLAY;
        img.style.imageRendering = IMAGE_RENDERING_PIXELATED;
        img.style.imageRendering = IMAGE_RENDERING_CRISP_EDGES;
        return img;
    }

    function performSubstitution(node) {
        if (shouldIgnoreNode(node)) {
            return;
        }

        const regex = new RegExp(KEYWORD, 'gi');
        const parts = node.data.split(regex);

        if (parts.length <= 1) {
            return;
        }

        node.data = parts.pop();

        parts.forEach(part => {
            const textBefore = document.createTextNode(part);
            node.parentNode.insertBefore(textBefore, node);

            const img = createImageElement(node.parentElement);
            node.parentNode.insertBefore(img, node);
        });
    }

    function substituteInPage() {
        const xpath = `//text()[contains(translate(., 'ABCDEFGHIJKLMNOPQRSTUVWXYZ', 'abcdefghijklmnopqrstuvwxyz'), "${KEYWORD}")]`;
        const nodes = document.evaluate(xpath, document, null, XPathResult.ORDERED_NODE_SNAPSHOT_TYPE, null);

        for (let i = 0; i < nodes.snapshotLength; i++) {
            const node = nodes.snapshotItem(i);
            performSubstitution(node);
        }
    }

    function runSubstitutionWithDelay() {
        setTimeout(substituteInPage, SUBSTITUTION_DELAY);
    }

    document.addEventListener('DOMContentLoaded', runSubstitutionWithDelay);

    const observer = new MutationObserver((mutations) => {
        mutations.forEach(mutation => {
            if (mutation.addedNodes.length) {
                runSubstitutionWithDelay();
            }
        });
    });

    observer.observe(document.body, {
        childList: true,
        subtree: true
    });

    runSubstitutionWithDelay();
})();
